import React from "react";

const ToDoForm = () => {
  return (
    <div className="TodoForm">
      <input
        type="text"
        className="todo-input"
        placeholder="enter the your task.."
      />
      <button type="submit" className="todo-btn"></button>
    </div>
  );
};

export default ToDoForm;
